import "./DescriptionStyles.css"

const Description = () =>{
    return(
        <div className="description">
            <h1>Search, Request, Match, Chat</h1>
            <p>After creating a mentee account, use the search button to search through our database of mentors, using keywords and filters to find one just for you. Then, send them a match request! If they accept, you will be able to chat with them and gain advice in any area you need. </p>
        </div>
    )
}

export default Description
